                var html_41743ae86bff4584aa511c724119a9e6 = $('         <div id="html_41743ae86bff4584aa511c724119a9e6"                 style="width: 100.0%; height: 100.0%;">                 Bicycle Crash Witness/Angel:  	At around 3:00pm, Saturday, May 9th, 2015, I was riding my blue road bicycle east on South Jackson Street at 5th Avenue South. It was a dry, sunny day, warm for early May. I skidded on the streetcar trolley tracks and crashed hard on my left side. I learned later at the hospital emergency room that I shattered my left collar bone. Didn&#39;t just break it, but shattered it into three big pieces and numerous small pieces. As I was laying on my back in the street, you came out into the street from the sidewalk, reached down and lifted my bicycle off of me. I don&#39;t remember if you asked if you should do that. Apparently you just knew that it was the right thing to do. You might be in your 20&#39;s or 30&#39;s, with shoulder-length brown hair. You took my bike over on the sidewalk, and then came back and knelt down next to me at my left side. You moved so smoothly, like you were floating, not walking. I told you that my collar bone was broken. You told me that an ambulance was coming and that I would be OK. You asked me what happened, and you told me that you saw the crash. We talked about how I landed hard on my left side, my hands still on the handlebars when I hit the pavement. Most people in situations like this are excited and talk fast, maybe a little louder then usual. Your voice was even, very matter-of-fact. Yes, you do have a broken bone. Help is on the way. By now a small crowd formed around us. One man suggested they should move me to the sidewalk. You told him that I should stay where I was and not to move me, that an ambulance would be there soon. You were so calm. I knew what had happened to me and was not anxious, but your calm serene presence helped me relax. A small crowd of people formed around me, but I felt like you were the main person there to help me. A minute later you said, &#34;The ambulance is here. You&#39;ll be OK.&#34; I thanked you for your help, and you repeated, &#34;you&#39;ll be OK.&#34; Then you walked back to the curb just when the firemen walked up to me. Again, you moved like you were gracefully floating away. I got loaded in the ambulance and taken to the hospital. My shoulder healed and I am fine now, back on my bike, but I remember you. I think about you occasionally, how you helped me. Meeting you was not a chance circumstance. My neighbors are nuns with Sisters of Providence. When I told them about you, the nuns told me that you were probably an angel. They said that I must be a good person and God knows that because he sent an angel to help me when I needed it. I am convinced that you are an angel, an actual angel, sent to help me in a moment of need. I wish I could meet you again, just to thank you and tell you how much I appreciate your help that day. It meant so much to me. I&#39;ll never forget you. Thank you.</div>                 ')[0];

                var html_653523ce621b4540b751be1c73d665a7 = $('         <div id="html_653523ce621b4540b751be1c73d665a7"                 style="width: 100.0%; height: 100.0%;">                 Dearest Julia.:  	I know you&#39;ll never see this seeing as how you have absolutely no reason to be on cl. However, I really hope you do. Dearest Julia, I miss you beyond rhyme and reason. I think about you every single day without fail, I can never be alone with my thoughts without thinking of you. Im not the same ignorant youth I was when we met, and I wish I could go back and change all the deplorable things I said and did, but that&#39;s not possible. We both lead different lives now, and honestly your life has to be better without me. I just wish I could have been smarter, nicer, Kinder, more truthful when I was younger. 19 year old me was such an idiot, he was so hurtful, I don&#39;t understand my actions now, I wish I could have talked some sense into that youth, but I don&#39;t think he would listen. I constantly think about how my life with you would be now, how maybe your kids would love me, I could hold them in my arms, love them as my own. Watch them grow and learn, help then with math and science. You and I could go on dates, we could love each other, hold each other, watch your kids grow as we grow. I still remember every detail of your face, those beautiful cheeks leading to your perfect jawline, those lovely dimples you call honeybuckets because they are so deep. I remember how your face is so nearly perfect in symmetry I made a few comments about it. I miss those piercing eyes that knew when I was lying, hurting, loving.. I remember the time, the single time I was able to see you. I was so nervous, I shaved just before you got to my work, my face was still red and warm due to the fact I dry shaved. Those few minutes seemed like an eternity when I held you in my arms. I was so nervous, so saddened, so riddled with pain and self loathing I didn&#39;t care to see the pain I caused you. After you left I went to the back and nearly broke down. Seeing the beautiful woman you were, in person, and thinking about how could I hurt someone like you...I was such a wretch when I was younger. You didn&#39;t deserve that pain. I&#39;m so sorry Julia. All in all, I know you&#39;ll never see this. If you do, I doubt you&#39;ll reply. You&#39;ve got my number, and I&#39;ve got yours. I wish I could make things right with you, I wish I could hold you,smell your hair, and hold your face next to mine. But I was an ignorant youth and I blew it. I&#39;m so sorry Julia, I love you still. Q</div>                 ')[0];
                popup_2a148d0787bf4c7f8dacfebe53f3b334.setContent(html_653523ce621b4540b751be1c73d665a7);

                var html_a9b826300cbd482dbc9001a9214451c9 = $('         <div id="html_a9b826300cbd482dbc9001a9214451c9"                 style="width: 100.0%; height: 100.0%;">                 Why do I miss her?:  	We met at church when we both where homeless. The attraction was intense and instant. After waiting for her to come out of the bathroom to talk she told me she was three months pregnant. I was fine with that. That night I had a dream she had a little girl. The next day I met her at the bus stop and she proceeded to tell me that her ultrasound revealed that she&#39;s having a little girl. A short time later we moved into a motel then our first apartment. When her daughter was born it was the best day of my life next to my son&#39;s birth. During our relationship we had our moments that where bad and that where some of the best in my life. I miss her so much it hurts every day. For a few years it felt as though I was over her. But these last few weeks she has been in my head and heart. I get this sinking feeling in the pit of my stomach and a empty hole in my heart. She has taken over my dreams and it feels as though she has been thinking of me as well. I wish I knew if she was thinking of me. I dont think she will ever want to talk to me for fear of my reaction. False allegations and horrendous lies made me want to see her hurt in the worst way. But years have gone by that made me change  for the better. I&#39;m now on meds and I have evened out. There was a time when I was unbalanced and would be a different person from day to day. My love for her seems to have never dissipated. I would have done anything for her and I mean anything. I don&#39;t want to use soul mate but now I seem to be struggling with that phrase. I feel like I should try to at least say hi but she has changed her name and it would feel stalker like if I did. Info from an email that was shut down after it was sent, informed me of the change. How do I handle this? I&#39;m having a hard time letting go. I could still possibly love you amy G. A.K.A amielia R, Ami R. Please get in touch with me. It feels like you check up on my Facebook. You can talk to me. I want to. If anything I need closer. R.</div>                 ')[0];

                var html_0aff625d931346189beb3e90a5102556 = $('         <div id="html_0aff625d931346189beb3e90a5102556"                 style="width: 100.0%; height: 100.0%;">                 Even after all this time? Always.:  	A, I still love you with all my heart. When you left, it tore me apart. I was so emotionally distraught that my heart physically swelled. I was depressed. I cut myself. I burned myself. I just wanted the pain to go away. While it has lessened with time, it never truly ended. True love never dies. Things dulled, and I did my best to move on...but not a day has gone by that I haven&#39;t thought about you. I took what small comfort I could in the assumption that you were happy, and I was contributing to that in the only way I could: staying out of your life. Today, I found out that you are in the hospital and have been for some time. I left work immediately and tried every avenue I could think of to get in contact with your family. I still have no idea if you even want to see me, but at least I&#39;ve tried. At the hospital I did my best, but I couldn&#39;t help crying while your mother filled me in on your condition. Even after all this time, the only thing I want to do is comfort you. I want to hold you, tell you that everything will be OK. I want you to know that I will always love you unconditionally...but I don&#39;t know if that matters to you. I&#39;m only human, and not even great at that most of the time, so I know that I made plenty of mistakes. Writing this is probably just another one, but I doubt you&#39;ll see it. I just had to get my feelings out... Please, just get better. If by my life or death I can protect you, I will. I would do absolutely anything for you, even if it is just to fade back out of your life. If you never want to see me again, I understand...but if ever you do, you know how to contact me. T</div>                 ')[0];

                var html_52f6be4a6f5345d29c6c7921130f703c = $('         <div id="html_52f6be4a6f5345d29c6c7921130f703c"                 style="width: 100.0%; height: 100.0%;">                 doing the math.:  	I count roughly 42 months total time that we have been married. During those 42 months, we&#39;ve spent only a total of almost 10 months &#34;together&#34; in random, short-lived spurts. That&#39;s only counting my schedule and not including any of your trips and ventures. The longest consecutive period of time we&#39;ve actually spent living together has been 5 months, and that was before all of these crazy life choices and cross-country moves actually began. That was right after we were married. That was right when the fairytale began. In over three and a half years, the longest stretch of time we&#39;ve lived together has been five months. And that was over three years ago. That&#39;s a remarkably dismal statistic, but it explains a lot. We&#39;ve never really had a chance for our love to grow together without some massive, lengthy interruption. We&#39;ve never had the chance to shed our insecurities, doubts, or fears. We&#39;ve never had the time to allow ourselves to ease into a comforting and peaceful love, because there was always so much uncertainty with everything going on. The impact it has had on both of us has been tremendous and fracturing. We&#39;ve never had the time to allow us to grow in love together. We also brought a child into this world during this time. Of his wonderful 24 little months on this earth, I&#39;ve either missed or have been living apart from him for 16 of those months. The longest consecutive period of time I&#39;ve spent with him living under the same roof has only been three and a half months. And that was from roughly the beginning of this year until mid-April. That&#39;s also the period of time in which I&#39;ve experienced the most joy and love in being with our son as a father, because I can actually be here to watch him grow. I can actually get to know my own son. Even now, despite our separation, I love him more and more each day, and the more time we spend together, the closer we get. I know the same would be true of you and me, too. The statistics do not lie. They explain the frustrations, the insecurities, the fears, the doubts, the uncertainty. They do not justify any transgressions committed, but they put it all into perspective. They bring it all full-circle. And yet, what is facing us is the prospect of a devastating and permanent separation that would see these statistics worsen. They would see us spending less and less time together, if any at all, with terms dictating when either of us could spend time with our son. And if that decision comes to fruition, that trend would continue on ad infinitum. We would, all three of us, come to personify those terribly dismal statistics. And that initial whirlwind period of 42 months time (read: five months time) would come to define us for the rest of our lives. What an absolutely horrifying thought to think. You&#39;ve mentioned before multiple times that you won&#39;t let yourself become one. That you won&#39;t let there be any more times for your heart to hurt. That you want to move on past this. What you don&#39;t see is that I want all of the same things you do. I neither want to cause hurt to you, nor do I want to hurt any longer. And I absolutely want to move on, too; past this, past all of the separation, the time spent apart, and back toward a comforting and peaceful love with you that only got a few months to grow. Back toward our little family. Back toward the time I never got, that was taken from me, that I had no choice in giving up, that I never wanted to sacrifice. Life owes us a second chance at the end of all of this, because five months together with you is not enough. And I owe you the fairytale that we started over three and a half years ago. I want a lifetime. I want our future to grow and bloom. I want our family to thrive in love like I know we can, and like we&#39;ve never had the opportunity to. I want to grow old with you. There was so much taken from me. I took so much from you, and it took so much out of you. Now is not the time to take the rest and keep taking forever. Now is the time to give. So give it one last shot. For everything we&#39;ve never had.</div>                 ')[0];

                var html_843414b566e64d9cb9f2d39cf5e94c7b = $('         <div id="html_843414b566e64d9cb9f2d39cf5e94c7b"                 style="width: 100.0%; height: 100.0%;">                 life in pictures.:  	. . .In my head, in my heart, in my soul. . . In the second room where your bed used to be is a pile of leftover belongings of yours stuffed into plastic garbage bags in the corner. Next to it sit three guitars inside dust-covered cases, untouched and neglected, reverberating a deafening silence that has filled this empty home since you&#39;ve gone from me. When I first took down all of the pictures of you and us, I put them in that room in a pile face-down so that I could walk through the front door again without feeling the immediate, choking wave of anguish that would come over me. Now they stand upright in their frames, positioned in a semi-circle near your other things, a makeshift shrine to my one and only constant I&#39;ve ever known. Three piles of used tissue adorn the beige carpeted floor next to their two empty boxes, with another two unopened and ready to be dutifully employed when I run out again. I spend the days and nights between places. The bedroom that was once an altar to a bright-red love sits in ruin, with the bedsheets strewn about the floor and the empty wooden shelving echoing every whisper you ever made into my ears at night. Both blinding, searing testaments to the sacrifice that the altar eventually demanded. I can stay for a few hours at a time at most before it becomes too much to bear. I go to the other room with our pictures and sit and cry until my lungs start to give out and my ribs feel like knives. I calm myself, catch my breath, see your face in a picture, and repeat. Until I can&#39;t. I wander through the rest of the house like a lost spirit searching for its anchor, its release, its final resting place. But I always return to the room with your pictures and find myself in front of your face, crying acid tears, heaving, trembling from the fear and the trauma, on my knees and begging, pleading to a god I&#39;ve barely known to deliver you back to me some way. It feels like you are dead. I memorialize a person and a love that was taken so suddenly and completely from me that the grieving bears the same kind of haunting, all-consuming weight. Each time I enter the room and sit at your pictures, the weight presses back a little stronger. And each time my trembling, exhausting, tear-filled supplication lasts a little longer. This is not a healing. This is the most profound death of a heart. We are bound forever, you and I. We are kinetic, and eternal. I do not see in color without you. I do not find purpose without your compass to guide me along the way. I keep coming back to the room with you in pictures, seeing only you as my constant that anchors my spirit and heart to this world. I cannot do this without you. Connect to me again out there tonight. Feel it, believe it, follow it without hesitation. It will not fail you. I will not fail you.</div>                 ')[0];

                var html_d229c5e44a83417ba6ef8780483e0d28 = $('         <div id="html_d229c5e44a83417ba6ef8780483e0d28"                 style="width: 100.0%; height: 100.0%;">                 I&#39;ll hurt for the rest of my days:  	I reckon I have about a 50/50 chance of you reading this. I&#39;ve had worse odds by dumber moves and still risked it. So there. I&#39;m pretty sure most everyone will call me crazy, and I&#39;m okay with that. My &#39;missed connection&#39; is my ex wife. Not JUST a missed connection, but also the source of more pain than I care to live with every day. I understand/totally get why you wanted a divorce. Lord knows, I&#39;ve had a lot of time to think about that, and to be quite honest, if the roles had been reversed, I most likely would have filed too. I can&#39;t say that for certain, but I do believe I would have. However, just because I get it doesn&#39;t mean I like it. I&#39;ve said it a thousand times before, and will continue to say it until my dying days; I am so very sorry for ruining what we had. Not only because it turned worlds upside down, but because you surely deserved so much better than what I gave. It was by my hands only. I know that. I&#39;ve been dreaming about you a lot lately. I wish I could say they were good, but they&#39;re not. So that really sets the tone for my days recently. I&#39;ll say it straight up. Yes. I&#39;ve tried a couple dating sites. I&#39;ve even gone &#39;out&#39; in what turned out to be ill attempts at finding someone knew in my life. I DON&#39;T WANT ANYONE ELSE! God damn it all!! This has sucked SO bad! Just through a message here and there on the sites, I get asked what I&#39;m looking for in a woman, and the answer is always the same. You! Couldn&#39;t even tell you how many profiles I&#39;ve skimmed right over. I&#39;m not interested in anyone else. Nobody is good enough. I told you MANY times while we were married (not sure if you believed me) but I can say on my life that I NEVER gave another woman a 2nd thought. Never even looked at another woman like that, ever since we&#39;d met. And it&#39;s still that way. Nobody else measures up. Sadly it took these years to do my searching. To take those long hard looks deep inside myself. I think I&#39;m the best version of me now. The most honest, caring, mindful, open, etc. It&#39;s sick how a crash course in life will put everything right there in your face. I try to look way back in my past to compare who I am now, as a person, but those days are long enough back that I don&#39;t really recall how I was. But now? Me now compared to ballpark 20 years ago?? Heck yeah! I had all sorts of sappy things about you that I was going to write about, but as I lay here typing, my heart is breaking for the billionth time. So, I will leave them out. There&#39;s no way I can get my hopes up at a chance just to be shot down in flames. With all that said, I DO wish I could at least tell you these things, and others. I&#39;m going to be alone the rest of my life. I&#39;m coming to grips with that. Nobody can tell me the whole &#39;Oh, you&#39;ll meet someone&#39; speech, because I won&#39;t. YOU are the bar/standard/only woman I&#39;m looking for. So it&#39;s that simple. I WON&#39;T meet anyone. You are perfect, and I let you go.------I&#39;ll never forgive myself for that. I&#39;m also going to be moving. There is nothing but pain for me here. I wish there was a way I could have you feel my pain without you. It is a literal/very real pain. The worst I&#39;ve ever felt, and by God, I&#39;ve felt some pains. My God, it hurts even to this very day. I reckon I&#39;ll sign off. I can&#39;t even formulate coherent sentences. Sorry for the bouncing around. I miss you...... I will always love you.....</div>                 ')[0];

                var html_2db198cd2939448ba55a752521f4b489 = $('         <div id="html_2db198cd2939448ba55a752521f4b489"                 style="width: 100.0%; height: 100.0%;">                 When you can taste the love, priceless:  	And what is it to work with love? It is to weave the cloth with threads drawn from your heart even as if your beloved were to wear that cloth. It is to bind a house with affection even as if your beloved were to dwell in that house. It is to sow seeds with tenderness and reap the Harvest with joy even as if your beloved were to eat that fruit. It is to charge all things you fashion with the breath of your own spirit and to know that all the Blessed dead are standing about you and watching. Often have I heard you say as if speaking in sleep he who works in marble and finds the shape of his own soul in the stone is nobler than he who plows the soil. And he who seizes the rainbow to lay it on a cloth in the likeness of man is more than he who makes the sandals for our feet. But I say not in sleep but in the over wakefulness of noontide he speaks not more sweetly to the Giant Oaks then to the least of all the blades of grass and he alone is great who turns the voice of the wind into a song made sweeter by his own loving. Work is love made visible. And if you cannot work with love but only with distaste it is better that you should leave your work and sit at the gates of the temple and take alms of those who work with joy. For if you bake bread with indifference you bake a bitter bread that feeds but half man&#39;s hunger. And if you Grudge the crushing of the grapes your Grudge distills a poison in the wine. And if you sing though as angels and love not the singing You muffle man&#39;s ears to the voices of the day and the voices of the night.</div>                 ')[0];

                var html_157451ca9dcc47bfb8ca592e2ebe99ba = $('         <div id="html_157451ca9dcc47bfb8ca592e2ebe99ba"                 style="width: 100.0%; height: 100.0%;">                 To the winds in a jar.:  	Within the confines of my mind I will always come to find myself burning with desire, yet carefully tucked tightly behind impenetrable walls and towering castle spires. I walk these streets half dead on my feet with glazed over eyes, it&#39;s hard to pinpoint the exact moment in time that I realized.. I was standing on precipice of heaven and earth, overjoyed and bewildered my anxiety turned into mirth... How is it that one can exist in the gray void areas of life, to whom shall I seek to mend my clipped wings or am I destined for strife? Selflessly I follow my own path steadfast as I find it right and true, and with this contentment peppered with hints of rue. To the selfishness of human nature seems no cure will ever be found, we are bound to inclination that more is worth acting like bloodthirsty hounds! Cowering with the thought you&#39;re towering with unbelievable indifference, yet you&#39;ll keep flogging that dead horse unrelentingly with belligerent persistence. You know as well as I do it&#39;s a blessing and a curse, to be awoken to untold tails and secrets of the universe.. How is it one can hold the power of the stars within ones own heart, yet at the same time have no idea how to use it let alone how to start... Under the full moons light I shall bathe to wash off the old, with the coming of the new moon the truth I will behold. Yet as each irreverent thought that graces my gray matter, ten fold the deferential reverent thoughts irregularly scattered and spatter.. I&#39;ve learned to think it could always be worse and never take anything for granted, and in this light of thinking I&#39;ve kept myself from becoming disenchanted... I know I have not the royal clout of a prince a king or a pontiff, for I lack the draconian inflexibility I&#39;m always thinking .....what if? Like a non-newtonian fluid I just go with the flow until pushed or stressed, I&#39;m firm in my beliefs for they have been righteously tried and put to the test. Negating negative naivety all the while sublimely scrupulously sagacious, prudently seeking divinity to the point most would call me madly daft &amp;amp; outrageous.. I&#39;ve read the sequestered books and my fingers know well the forgotten pages, like the clairvoyant gatekeeper alchemists before me throughout the ages... An unstoppable philosophical mind set helps intuitively in my shamanistic practices, behind closed doors or under old oak branches eating sacred cactuses. Mindful and silent I sit under the cover of the stars, within the still shadows of the night I sketch my memoirs.. I call out onto the unknown send me a valkyrie a warrior queen, the time is due for the unseen to be seen... With adoreing eyes I wish to gaze upon your infinite beauty, I wish to hold you in my strong arms with nothing but love and faithful duty. An open heart waits to lift you up when you fall down, a lonely king wish&#39;s to share his crown.. Night&#39;s like this make me think of the warm embrace in a lovers arms, the smell of sweet perfume &amp;amp; the grace of a lovely woman&#39;s charms... While I am a man indeed with desires of unbridled passion, I conduct myself in a more reserved old school type of fashion. One woman is all I can ask and hope from the divine, just one beautiful woman to hold tightly with love ....bodys entwined.. Within what could be seen as only imperfections, with nothing more the a simple inflection of view all is perfection... Now I may not be rich or deemed to glory, but I tell you something my life will make one a hell of a good story! Far from pedestrian I&#39;ve been cursed and I&#39;ve been blessed, hell I have even had my still beating heart ripped from my chest. I&#39;ve talked in depth with both God and the Devil, pondered and poised questions that made them both revel.. I have played chess and drank meed with the grim reaper, he is a kind quirky fellow and a very clever teacher... While walking this path is nothing new to me, I&#39;ve come to enjoy my own company. The quiet solitude drowning in my own thoughts, reflecting upon the should have&#39;s ought not&#39;s.. I keep coming back again to the same things time after time, I have an insatiable need for knowledge and words wrapped with rhyme... Who would have thought that someone like insignificant me, could have known how to open the door let alone held the key. Still I wait to walk though till the moment is right and the time is due, until the new day is born and dawn casts it&#39;s rays upon you.. I&#39;m waiting for you though not standing still nor holding idle, I&#39;ve let go of reins and let loose the bridle... To run wild with my passion&#39;s and just let curiosity flow, while embracing this profound inkling my madness begins to grow. Some would say it&#39;s true that I&#39;m as mad as a hatter, yet I don&#39;t feel as if my brain is scattered tattered or shattered.. But as a matter of fact things have never been so crystalline clear, a world seen with brand new eyes to watch and ears to hear! It&#39;s to my understanding as two become one that&#39;s amalgamation, but add love to the equation and something seems to get lost in translation. To become whole within undivided union once and for all... truly free, all I need to complete this metamorphosis is you standing next to me.. I wish and I pray that one day I will hold you in my arms, intoxicated with bliss divinely sublimely captivated by your charms... Alas I must be patient and focused for my will to succeed, I&#39;ll swim the deepest oceans &amp;amp; climb the highest peaks indeed! I will find you my Queen, just how remains unseen. Much love to you from me... ~23 and 3</div>                 ')[0];
